import React from 'react'
import {AppBar, Toolbar, IconButton, Tabs, Tab, Link} from '@material-ui/core'



function DeskTopView() {
  return (
       <Tabs
            value={0}
          >
            <Tab label="home" />
            <Link href="#about" color="inherit"><Tab label="about" /></Link>
            <Tab label="projects" />
            <Tab label="blog" />
            <Link href="#contact" color="inherit"><Tab label="contacts" /></Link>

          </Tabs>
  )
}

export default DeskTopView
